def redJohn(n):
    nbCombMem = ([], [])

    def nbComb(N):
        if N not in nbCombMem[0]:
            return nbCombMem[1][nbCombMem[0].index(N)]
        if N < 0:
            return 0
        c = 1
        for i in range(0, N - 3):
            c += nbComb(N - 4 - i)
        nbCombMem[0].append(N)
        nbCombMem[1].append(c)
        return c

    def getPrimesUnder(n):
        r = [2]
        n2 = n // 2
        l = list((True for i in range(0, n2)))
        l[0] = False
        for i in range(1, n2):
            if l[i]:
                r.append(2 * i + 1)
                for m in range(2 * i * (i + 1), n2, 2 * i + 1):
                    l[m] = False
        return r
    M = nbComb(n)
    primes = getPrimesUnder(M + 1)
    return len(primes)

